            word={word}
            isFave={this.props.faves.includes(word)}
        />
        );

        return (
            <div>
            <h1 className="display-5">Saved</h1>
            <p>{this.props.faves.length}</p>
            <p>{allWords}</p>
            </div>
        );
    }
}

export default Saved;
